import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#182e45',
        borderColor: 'black',
    },
    containerImg: {
        flex: 0.7,
        justifyContent: 'center',
        borderRadius: 100,
        height: 100,
        width: 100,
        marginHorizontal: '36%'
    },
    ImgUser: {
        width: 100,
        height: 100,
        borderRadius: 100,
        borderColor: 'black',
        borderBottomWidth: 5
    },

    itemsList: {
        backgroundColor: "#dad8cc",
        margin: 10,
        borderTopWidth: 0,
        borderBottomWidth: 7,
        borderLeftWidth: 1,
        borderRightWidth: 10,
        borderRadius: 4,
    }


});

